import React, { Component } from 'react';
import {
  Route
 
} from "react-router-dom";
import * as ReactBootStrap from "react-bootstrap";
import { NavLink} from "react-router-dom";



import Home from "./MainPage/Home";
import Register from "./MainPage/Register";
import User from "./MainPage/User";
import Admin from "./MainPage/Admin";
//import Transfer from "../MainPages/Transfer";
import About from "./MainPage/About";
import ContactUs from "./MainPage/ContactUs";

import './MainPage/style.css';

class HeaderComponent extends Component {
    render() {
      return (
        <div>
        <div>
      <ReactBootStrap.Navbar collapseOnSelectexpand="lg" bg="dark" variant="dark"   >
        <ReactBootStrap.Navbar.Brand js-scroll-trigger a href="/Home">
          Merit Bank
        </ReactBootStrap.Navbar.Brand>
        <ReactBootStrap.Nav.Link js-scroll-trigger a href="/ContactUs">
              Contact Us
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link js-scroll-trigger a href="/About">
              About Us
          </ReactBootStrap.Nav.Link>

      </ReactBootStrap.Navbar>
        </div>

        <div className="content">
                <Route exact path="/" component={Home}/>
                <Route path="/About" component={About}/>
                <Route path="/ContactUs" component={ContactUs}/>
                <Route path="/Register" component={Register}/>
                <Route path="/User" component={User}/>
                <Route path="/Admin" component={Admin}/>
            </div>



        </div>
      
      );
    }
  }
 //<Route path="/Transfer" component={Transfer}/>
export default HeaderComponent;
